    border: "1px solid",
    borderColor: "red",
  },
  img: {
    height: "500px",
    margin: "10px",
    boxShadow: "0px 3px 10px 3px  red",
  },
};

function Home() {
  return (
    <div>
      <h1>gaga</h1>
      <Tabs style={{ borderBottom: 1, borderColor: "divider" }}>
        <TabList>
          <Tab.Screen name="Home" />
          <Tab.Screen name="Heroes" />
        </TabList>

        <TabPanel>
          <h2>Any content 1</h2>
        </TabPanel>
        <TabPanel>
          <h2>Any content 2</h2>
        </TabPanel>
      </Tabs>
    </div>
  );
}

export default Home;
